INSERT INTO `maintopic` VALUES (1,'AnNinhChinhTri','Khng nh bo v ch quyn l nhim v thing ling, Th tng Nguyn Tn Dng yu cu Trung Quc khng ti din hnh vi t tri php gin khoan trn thm lc a ca Vit Nam\nTh tng nh gi cao v biu dng cc c quan chc nng, lc lng thc thi php lut trn bin, b con ng dn, ng bo trong v ngoi nc  biu th thi  v trch nhim cao, u tranh bo v ch quyn thing ling ca T quc\nKhm xt nh ca Alomar, cnh st tm thy 165 gram heroin giu di thm t bt a v 55 gram ma ty   l thng gi trn trn nh tm. Alvarado v Alomar c th phi i din vi mc n t 10 nm n chung thn.\nM ang d tnh gia tng hot ng trinh st v s hin din hi qun gn cc vng bin tranh chp  i ph vi hnh vi bnh trng ch quyn chm m chc ca Trung Quc. Tuy nhin, hiu qu ca chin thut ny vn cn l mt du hi. \nAn ninh khu vc b e da nu Trung Quc xy cn c  Trng Sa\nNgoi 5 cn b cp tnh b k lut, Thanh tra Chnh ph cng pht hin nhiu v vic lin quan tham nhng, gy tht thot s tin hn 2,3 t ng. \nTAND ti cao ti H Ni m phin x xem xt khng co ca Nguyn Duy Linh (25 tui,  huyn Thanh Oai) xin gim nh ti Git ngi\nKhng chu ni i, hung th git v ra u th\nTi phi lm g  t co hnh vi phm php ny. Ti bit hn l k th on, quan h rng nn rt s\nCuc truy tm nhm x n gy 5 v cp chn ng Si Gn\nSau trn ng Nai thua 3-5 trc i ch nh Than Quang Ninh chiu qua (20/7) ti vng 21 V-League 2014, c quan an ninh  gp v thm vn 6 cu th i khch ti khch sn, v nhng biu hin v thng tin lin quan n nghi n tiu cc trong trn u.\ni tng dn xp v git ngi ln trn sut 5 nm rng mi sa li cng an.\nTrong v n ny, Ng Quang Trng v V Vn Lun b kt n t hnh, 7 i tng khc cng b kt n t. Thng 1-2014, ng Trng  qua i ti tri giam Ch Ha do bnh trc khi thi hnh bn n t hnh.\nNhng g n ca \"n qui\" Dung H l nhng tn sng s vn ni danh vi nhng phi v m thu chem mn hay thanh trng kiu x hi en.\nSau khi b 4 anh em h thay nhau hm hi, thiu n 16 tui ri vo trng thi tm thn bn lon.\n c nhiu khch n mua dm, cc gi bn dm  nh Tc chp nh kha thn ri tung ln mng cu khch.\nGi mi dm khng cn ng ng, b ch cha, bo k n chn na. Ch cn tr mt khon ph nh cho ch web sex, cc c gi s c lng x rng ri, v c th ngi nh t giao dch vi khch.\nTun dng dao khng ch, tri tay, dn ming ng bn l nhn vin nh bng bng bng dnh. Mt tn khc lao ti khng ch n th qu p m kt st cp gn mt t ng.\nSau hn mt nm thc hin v cp ti xch ca ngh s Hng Vn lm nn nhn gy c xng i, Trung v ng bn phi hu to\nRng sng 19/7, cnh st pht hin hng chc ngi mang theo v kh vn chuyn 108 bnh heroin ti a phn bn Thung Cung, Vn H, Vn H, Sn La\nSau 5 km vt ng rng ly li do nh hng ca bo, Cng an tnh Sn La p st nhm ngi vn chuyn ma tu, ku gi u hng nhng b chng bn tr quyt lit\nTh tng Malaysia Najib Razak cng phu nhn ang thm chnh thc Vit Nam, sau khi ng trc tip chng kin hot ng tm kim chuyn bay MH370 mt tch  Australia\nCnh st v lc lng bo an c tng cng dy c ti qung trng Thin An Mn v nhiu a im tp trung ng ngi khc  Trung Quc sau v tn cng nh ga  tnh Vn Nam lm 29 ngi thit mng.\nNn nhn c ngi dn a i cp cu nhng  t vong vo ngy hm sau.\nCc Cnh st Phng chng ti phm s dng cng ngh cao (C50) - B Cng an cng cc c quan chc nng va trit ph nhiu nhm i tng pht tn tin nhn rc la o chim ot ph dch v ca cc thu bao di ng.\nMy bay mang s hiu MH17 ca hng hng khng Malaysia Airlines b bn ri ngy 17/7 ti min ng Ukraine, khin 298 ngi thit mng. Cho ti nay, nhiu cu hi quan trng v thm ha ny vn cha c li gii p tha ng.\n cng \"phiu\" vi ma ty , cp tnh nhn  chn nh ngh lm bn .\nSau khi ly ht ti sn, 4 tn i bi a c gi vo rng keo ri thay nhau gi tr i bi.\nSau khi tho mn, k t nhn l cng an  tri tay nn nhn  cp iPhone, xe my...\nTi ni  ca Collins, cnh st thu c nhiu vt mu  kh. C th hn  git mt vi nn nhn ti nh sau  phi tang xc  nhng ni khc.\nHnh vi giao cu vi t thi khng ch bin y thnh \"con qu\" dm  m cn lm kh v, kh con.\nTng thng Nga Vladimir Putin cho rng khng c chnh tr ha v my bay MH17 gp nn v cc nc cn lm mi vic  m bo an ton ti hin trng cho cc nh iu tra quc t. \nGn chc ngi c cho l lin quan n nghi n bn  trong trn ng Nai - Than Qung Ninh  b bt ngay sau trn cu kt thc chiu 20/7.\nCc Cnh st iu tra ti phm v trt t x hi - B Cng an pha Nam (C45B) cho bit, n sng 21/7, c 4 cu th  i ng Nai, mt ngi  i ng Tm - Long An v t nht 4 c nhn khc  b bt gi v nghi lin quan n nghi n bn .\nHu ht ngi dn Nga t ra bc xc trc vic phng Ty v Ukraine  li cho Tng thng Vladimir Putin v thm kch my bay MH17, ng thi t ra nhiu gi thuyt m mu lin quan n M ng sau v vic ny.\nThanh tra chnh ph kt lun ng L Thanh Cung, Ch tch tnh Bnh Dng khng phm lut nh ng i gia Hunh Uy Dng t co. Ngc li, theo Thanh tra Chnh ph, Th tng  ch o c quan chc nng lm r vic phn l bn nn ti KCN Sng Thn 3 do cng ty ng Dng lm ch u t.\nChiu 22/7, Hi ng thi hnh n t hnh thnh ph H Ni  thi hnh n t hnh vi Nguyn c Ngha (30 tui,  phng Ph Lm, qun Kin An, Hi Phng) can ti Git ngi, Cp ti sn\nPht hin nam thanh nin nghi vn, cc trinh st m thm theo di v ra tay bt gn khi ngi ny va git ti sn ca nn nhn\nTrong vi ngy qua Trung Quc  cng b mt lot ng thi phi php trn qun o Hong Sa thuc ch quyn ca Vit Nam, nh thnh lp y ban dn c khu vc o Hu Nht, khai thng tuyn hng hi ti o Duy Mng\nThng tin t Tnh y Bn Tre ngy 23/7 cho bit, y ban Kim tra Trung ng ng (UBKTTW)  cng b quyt nh tin hnh kim tra ng vin c du hiu vi phm i vi ng Trn Vn Truyn (nguyn Tng Thanh tra Chnh ph). \nTh nghim thc t trn chic smartphone Redmi Note ca hng in thoi Trung Quc Xiaomi c bn ti th trng Vit Nam cho thy chic smartphone ny m thm kt ni v gi thng tin ngi dng v mt my ch t ti Trung Quc, nh nhng bo co c a ra gn y.\nVch trn chiu la ca nhm i tng i Loan nhm vo ngi Trung Quc\nMt th on la o cng ngh cao hon ton mi do nhm ngi i Loan  Trung Quc thc hin trn lnh th Vit Nam va b cng an TPHCM pht hin\nSng 23.7, i CST ti phm v TTXH Cng an Q.Tn Bnh (TP.HCM) chnh thc tip nhn clip ghi cnh nh p tr t k  Trng tiu hc chuyn bit Anh Vng, do PV Thanh Nin cung cp,  phc v cng tc iu tra.\nMua dm l hnh vi vi phm php lut, vi phm o c x hi, tri vi thun phong m tc. Do vy, cng khai danh tnh ngi mua dm l hon ton ph hp vi lut php\nHm , kim tra hnh chnh mt nh ngh  phng Phc Din, qun Bc T Lim, cnh st bt qu tang 4 i nam n c hnh vi mua bn dm. 4 c gi bn dm u trong  tui 9X, a s l sinh vin.\nng Thanh c cho l chm v cht ti ch sau khi git m gi giu xc vo x bp.\nTheo iu tra ban u, sng cng ngy, sau khi v l L Th Ton (50 tui) i ch, Thanh  nh vi m V Th Nguyt (88 tui). Khong 9h, ngi n ng ny bt ng cm dao h st m gi, ko xc vo x bp ri dng hai bao tru chn ln.\nKhi ma dn gian khng cn c cc phng tr chung, Vn Anh xin lm PG trong nhm ca o ri gia nhp ng dy bn dm do anh ta t chc.\nChiu 27/7, Cng an tnh Tin Giang  phi hp cc c quan chc nng khm hin trng, khm nhim t thi nam gii tri trn sng vi 2 chn b ct cht.\nLin quan n v n mng git m  v v ri phi tang xc ngay ti nh  x Triu Thnh, huyn Triu Sn (Thanh Ha), Cng an tnh Thanh Ha cho bit, nghi can c tin s bnh tm thn, khng lm ch c hnh vi nn rt kh khi t v n.\nNhm hip s Bnh Dng chia s kinh nghim cho nhm hip s TP.HCM bng cch hai nhm cng nhau ra ng bt trm cp. Kt qu, mt n tc sa li v khng thot c nh mt tinh tng ca chng hip s ni ting ca vng t Gm.\nTrung Quc ang tin hnh tp trn bn n tht trn vnh Bc B, gn st Vit Nam v s bt u tp trn ti bin Hoa ng vo ngy 29/7 ti.\nNu nh trc y n voi ln tung honh dc ngang gia i ngn, gip ng bo Ty Nguyn gi rng, gi t, bo v bun lng th nay do nn ph rng v sn bn tri php, voi  Ty Nguyn ang c nguy c b tuyt chng.\nt pht sau khi pht hin b Cc m a mu, ngi dn tm thy ng Mnh bt tnh vi l thuc tr su trn tay.\nKhi ma dn gian khng cn c cc phng tr chung, Vn Anh xin lm PG trong nhm ca o ri gia nhp ng dy bn dm do anh ta t chc.\nMt ngi trc tip nhp hng cng 2 nhn vin hi quan  b  ngh truy t do  l hng hiu xut x chu u np bng hng Trung Quc trn thu hng chc t ng.\nChn c gi trn ng, nhm thanh nin qut nt, i \"bt v n\". Khi chng b i cng vi xe my ca nn nhn, cc nhn chng mi bit y l nhm cp gi danh.\nm 80 triu ng chy vo mt ngi nh c th, Thanh bn b thng lnh o phng Cnh st hnh s Cng an tnh H Tnh trc khi b bt.\nHai ngy ung nc da  sng, chu khng ni i v s tn cng ca cn trng, k nh cht v ra u th, khai hnh vi d man.\nHai k cm u cc nhm giang h mi ni ti TP HCM  mang sng, m tu xng vo nh hng chm ngi tr th cho n em.\nQua iu tra, t hnh nh camera v li khai nhn chng, cnh st xc nh 2 nghi can trc tip gy n l c v Lm nhng h  b trn.\nBit ngi n b c nhan sc mun quen i gia, g bn v s do nhit tnh mai mi  lp mu git ngi, cp ti sn.\nHai thng sau v chm tu trn vng bin Cn Gi lm 9 ngi i m ci thit mng, Cng an TP HCM  bt giam Gim c Cng ty Vit - Sc v ngi ng u ca Vng Tu Marina.\n35 nm  qua, nhng nhng ngn ni, thn cy dc bin cng mt di pha Bc vn cn  nhng du n v cuc chin bo v t nc trc qun xm lc Trung Quc. T Mng Ci n Lai Chu, t huyn n thn bn no cng gp cc nh bia ghi tn nhng ngi lnh  ng xung trong nhng thng nm khc lit y.\nChiu 27.7, Cng an qun Lin Chiu ( Nng) xc nh nguyn nhn v ng Cao Vn Mnh (53 tui, tr t 5 phng Ha Hi, qun Ng Hnh Sn, TP. Nng) m cht b Mai Th Cc (52 tui, tr K166/34 Nguyn Lng Bng, phng Ha Khnh Bc, qun Lin Chiu) ri t t l do mu thun tnh i.\nLc lng thi hnh nhim v phi n sng v trong qu trnh khng ch i tng, thiu t Nguyn Vinh Cnh, Ph phng Cnh st hnh s Cng an tnh H Tnh  b thng do mt vin n xuyn vo i. n hn 10 gi cng ngy hung th b lc lng chc nng bt gi cng vi 1 khu sng, 2 vin n, 80 triu ng va ly ca gia nh anh Thin. Ti c quan iu tra, hn khai nhn l Phan Xun Thanh (32 tui, ng P.Ca Nam, TP.Vinh, Ngh An).\nUBND TP.H Ni yu cu trong vng 6 thng k t ngy khi cng, Vinaconex phi hon thnh ton tuyn ng ng nc sch sng  bng thp. \nSng 27.7, tha y quyn ca Ch tch nc, Thng trc Thnh y, HND, UBND v y ban MTTQ VN TP.HCM t chc l truy tng danh hiu B m VN anh hng cho 831 m ti 4 cm qun, huyn v 3 n v trn a bn TP c ng cc m c truy tng. \nSng 27.7, Ch tch nc Trng Tn Sang n kim tra tin  ng tu kim ng KN 782 ti Cng ty TNHH ng tu H Long, TP.H Long, Qung Ninh. \nNgy 27.7, Cng an tnh H Tnh cho bit  bt gi k tng tin ngi dn v bn b thng mt cn b cng an. \nTheo Cc An ton thc phm (B Y t), thi gian gn y, cc c s iu tr ti  Nng, TP.HCM tip nhn iu tr nhiu ca bnh nng, din bin nguy kch v  c mt s trng hp t vong do s dng c sn lm thc n, cha bnh; vic s dng c sn  dng sng, ti, nng lm xut hin bnh l cp tnh nh hng n sc khe v tnh mng ca ngi n.\nTheo c quan iu tra, trong s cc b can mi gii cho khch mua dm c nhiu gi mi dm cha  16 - 18 tui, nn c quan iu tra  